import React from 'react';

function Login() {
    return (
        <div className="Login">
            <div>
                <img src="/assets/Spotify_Logo.png"/>
                <a className="btn-spotify" href="/auth/login" >
                    Login with Spotify 
                </a>
            </div>
        </div>
    );
}

export default Login;
